                                        '{"extra":["03.06.22\\nСкоро лето, а значит, что у меня и у многих игроков будет больше времени на игру. Оформление моей ямы закончено, теперь остались только здания и монстры. Мне бы хотелось в этом году уже закончить свой проект. Арт надо бы тоже достроить."],"text":""}',
