                                      value:
                                        '{"extra":["ческие тоннели, ведущие к зданиям в городе.\\n\\nЯ не рассказывала здесь об ОКК? ОКК, или, если расшифровать, Орден Красного Камня - это команда редстоунеров, в числе которых WiCry, Steinyasha, KIPO4 и их друзья и братья."],"text":""}',
